import Button from '../UI/Button/Button'
import styles from './StartQuiz.module.css'
import Input from '../UI/Input/Input'

let StartQuiz = () =>{
    return(
        <div className={styles["start-screen"]}>
            <div className={styles["start-info"]}>
                <label htmlFor='user-name'>User Name : </label>
                <Input data={{type:'text',id:'user-name',name:'user-name',className:styles.inp}}></Input>
            </div>
            <Button data = {{'type':'button','className':'styles.btn'}}>Start Quiz</Button>
        </div>
    )
} 

export default StartQuiz;
